import "./navbar_banner.css"
import Display from "./navbar_banner_data"
import left from "./Images/left.png"
import right from "./Images/right.png"
import { Link } from "react-router-dom"

export default function Banner(){

const data = Display.map(data=>{

    return(
        <div>
        <BannerData
        name= {data.name}
        img= {data.img}
        description = {data.description}
         />
         <productDescription
         name= {data.name}
        img= {data.img}
        description = {data.description}
         />    
        </div>

    )
})


 let i=0

 const [productDisplay,setProductDisplay] = React.useState(data[i],)

//On Click Function
 function Left(){
        if(i==0){
            return(
                setProductDisplay(data[i])
            )
        }
        else{
            setProductDisplay(data[i=i-1])
        }
 }
 function Right(){
    if(i==Display.length-1){
        return(
            setProductDisplay(data[i])
        )
    }
    else{
        setProductDisplay(data[i=i+1])
    }
 }

//  Product-Description
function productDescription(props){
    return(
        <div>
            <div id="product-top">
                <div id="product-desc">
                    <h1>{props.name}</h1>
                    <a><strong>Rs 249/-</strong></a>
                    <p>{}props.description</p>
