                </div>


                <div id="product-image">
                    <img src={props.img} />
                    <div id="more-images">
                        <div className="more-images"></div>
                        <div className="more-images"></div>
                    </div>
                </div>
        </div>
        </div>

    )
}


function BannerData(props){
    if(i==0){
        return(
            <div id="banner">
            <div className="end"></div>

               <div id="banner-text">
               <Link to="/products" ><a onClick={productDescription}>{props.name}</a></Link>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img">
                    <img src={props.img} />
                </div>

                <div className="slider" onClick={Right}><img src={right} /></div>   

            </div>
        )

    }
    else if(i==Display.length-1){
        return(
            <div id="banner">

                <div className="slider" onClick={Left}><img src={left} /></div>

               <div id="banner-text">
               <Link to="/products" ><a onClick={productDescription}>{props.name}</a></Link>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img">
                    <img src={props.img} />
                </div> 

              <div className="end"></div>     
            </div>
        )
    }
    else{
        return(
            <div id="banner">

                <div className="slider" onClick={Left}><img src={left} /></div>

               <div id="banner-text">
               <Link to="/products"><a onClick={productDescription}>{props.name}</a></Link>
                <p>{props.description}</p>
                </div> 

                <div id="banner-img">
                    <img src={props.img} />
                </div>

                <div className="slider" onClick={Right}><img src={right} /></div>

            </div>
        )
    }

}

   return(
    <div>
         {productDisplay}
         {i}
    </div>
   )
}
